webpackJsonp([0xf927f8900006],{518:function(e,t){e.exports={pathContext:{html:'<p>Hi; my name is <strong>Esteban Torres</strong> and I\'m an <code class="language-text">iOS</code> developer from rainy <strong>Costa Rica</strong>; moved to Berlin to work @ <a href="https://soundcloud.com"><code class="language-text">SoundCloud</code></a>.</p>\n<p>You can find a (hopefully updated) version of my <code class="language-text">CV</code> <a href="https://estebantorr.es/cv/index.html">here</a></p>\n<p>I love innovation and I\'m usually an early adopter whenever I can which, more times than none, has bitten me in the ass.</p>\n<!-- more -->\n<p>Mostly wander around <code class="language-text">Cocoa</code> &#x26; <code class="language-text">Cocoa Touch</code> "realms" but lately I\'ve been trying to expand towards <code class="language-text">Ruby</code>, <code class="language-text">Rails</code> and obviously <code class="language-text">Swift</code>.\nI really <strong>LOVE</strong> <em>OSS</em> and at times try to contribute as much as possible and try to get involved with the community; some times though I find myself too overwhelmed with a lot of projects and thus tend to distance myself for some months.</p>\n<p>I try to be active in conferences but only if I can find a topic I\'m super passionate about; try to avoid giving hollow talks just for the sake of giving talks.</p>\n<p>You can find me on GitHub and pretty much always lurkin on Twitter here <a href="https://twitter.com/esttorhe">@esttorhe</a></p>'}}}});
